var pieces_files = [
    "data:image/png;base64, ",
    "data:image/png;base64, ",
    "data:image/png;base64, ",
    "data:image/png;base64, ",
    "data:image/png;base64, ",
    "data:image/png;base64, ",
    "data:image/png;base64, "
];

bg_image = createImage("data:image/png;base64, ");
rect = createImage("data:image/png;base64, iVBORw0KGgoAAAANSUhEUgAAABMAAAATCAYAAAByUDbMAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAEnQAABJ0Ad5mH3gAAAAoSURBVDhPYwCC/1TEDP+pAUYNIx2MGkY6GDWMdDBqGOkAbhh1MMN/AJwCx3FiV4sdAAAAAElFTkSuQmCC");

keys = {
    38: "up", // key up
    40: "down", // key down
    37: "left", // key left
    39: "right", // key right
    87: "up", // w
    83: "down", // s
    65: "left", // a
    68: "right", // d
};

key_events = {
    "up": (gameData) => {
        curr_degree = gameData.degrees;
        gameData.degrees = (gameData.degrees + 1)%4;
        next_x = Math.min(gameData.x, gameData.width - gameData.getPieceWidth());
        next_y = Math.min(gameData.y, gameData.height - gameData.getPieceHeight());
        if (gameData.validMove(next_x, next_y)) {
            gameData.x = next_x;
            gameData.y = next_y;
        } else {
            gameData.degrees = curr_degree;
        }
    },
    "down": (gameData) => {
        next_y = gameData.y + gameData.delta;
        if (gameData.validMove(gameData.x, next_y)) {
            gameData.y = next_y;
            return true;
        } else {
            return false;
        }
    },
    "left": (gameData) => {
        next_x = gameData.x - gameData.delta;
        if (gameData.validMove(next_x, gameData.y)) {
            gameData.x = next_x;
        }
    },
    "right": (gameData) => {
        next_x = gameData.x + gameData.delta;
        if (gameData.validMove(next_x, gameData.y)) {
            gameData.x = next_x;
        }
    },
}

key_presses = [];
window.onload = function () {
    document.getElementsByTagName('body')[0].onkeyup = function (e) {
        if (keys[e.keyCode]) {
            key_presses.push(keys[e.keyCode]);
        }
    }
};

function createImage(src) {
    img = new Image();
    img.src = src;
    return img;
}

pieces_images = [];
pieces_files.forEach((src) => {
    pieces_images.push(createImage(src));
});

degrees = [0, 90, 180, -90];

gameData = {
    offScreenCanvas: new OffscreenCanvas(bg_image.width, bg_image.height).getContext("2d"),
    ctx: document.getElementById("tetris").getContext("2d"),
    x: rect.width*4,
    y: 0,
    delta: rect.width,
    degrees: 0,
    currentPiece: 5,
    width: rect.width*10,
    height: rect.width*20,
    xOffset: (bg_image.width % rect.width) / 2,
    yOffset: (bg_image.height % rect.height) / 2,
    getRotation: function() {return degrees[this.degrees] * Math.PI / 180.0;},
    getX: function () {return this.x + this.xOffset;},
    getY: function () {return this.y + this.yOffset;},
    getPiece: function() {return pieces_images[this.currentPiece];},
    getPieceWidth: function () {return this.degrees%2 == 1?this.getPiece().height:this.getPiece().width;},
    getPieceHeight: function () {return this.degrees%2 != 1?this.getPiece().height:this.getPiece().width;},
    getPieceBitmap: function () {
        piece = this.getPiece();
        w = this.getPieceWidth();
        h = this.getPieceHeight();
        canvas = new OffscreenCanvas(w, h);
        ctx = canvas.getContext("2d");
        ctx.translate(w/2, h/2);
        ctx.rotate(this.getRotation());
        ctx.drawImage(piece, -(piece.width/2), -(piece.height/2));
        return ctx.getImageData(0, 0, w, h);
    },
    nextPiece: function () {
        this.offScreenCanvas.save();
        this.offScreenCanvas.translate((this.getPieceWidth()/2) + this.getX(), (this.getPieceHeight()/2) + this.getY());
        this.offScreenCanvas.rotate(this.getRotation());
        this.offScreenCanvas.drawImage(this.getPiece(), -(this.getPiece().width/2), -(this.getPiece().height/2));
        this.offScreenCanvas.restore();
        this.ctx.putImageData(this.offScreenCanvas.getImageData(0, 0, bg_image.width, bg_image.height), 0, 0);
        this.currentPiece = Math.trunc(Math.random() * pieces_images.length);
        this.x = rect.width*4;
        this.y = 0;
        this.degrees = 0;
    },
    validMove: function(xx, yy) {
        w = this.getPieceWidth();
        h = this.getPieceHeight();
        if (xx < 0 || xx + w > this.width) {
            return false;
        }
        if (yy + h > this.height) {
            return false;
        }
        off = this.offScreenCanvas.getImageData(xx+this.xOffset, yy+this.yOffset, w, h);
        pieceBmp = this.getPieceBitmap();

        document.getElementById("tst").getContext("2d").clearRect(0, 0, 800, 600)
        document.getElementById("tst").getContext("2d").putImageData(off, 0, 0);
        document.getElementById("tst").getContext("2d").putImageData(pieceBmp, 0, gameData.delta*5);

        for (i = 0; i < off.data.length; i += 4) {
            if ((pieceBmp.data[i+3] != 0 && off.data[i+3] != 0)) {
                console.log(off.data.slice(i, i+4));
                return false;
            }
        }
        return true;
    }
}

function gameLoop() {
    while (key_presses.length > 0) {
        k = key_presses.shift();
        key_events[k](gameData);
    }
    /*if (!key_events["down"](gameData)) {
        gameData.nextPiece();
    }*/
    key_presses = [];
    gameData.ctx.drawImage(bg_image, 0, 0);
    gameData.ctx.drawImage(gameData.offScreenCanvas.canvas, 0, 0);
    gameData.ctx.save();
    gameData.ctx.translate((gameData.getPieceWidth()/2) + gameData.getX(), (gameData.getPieceHeight()/2) + gameData.getY());
    gameData.ctx.rotate(gameData.getRotation());
    gameData.ctx.drawImage(gameData.getPiece(), -(gameData.getPiece().width/2), -(gameData.getPiece().height/2));
    gameData.ctx.restore();
}

setInterval(gameLoop, 500);

